output_sparql:
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
prefix ph: <https://data.labs.kadaster.nl/kadaster/praktijkhandleiding/>
prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>
prefix schema: <http://schema.org/>
prefix skos: <http://www.w3.org/2004/02/skos/core#>
select
?objectLabel ?objectDefinitie ?legislation ?phURL ?relaties
(group_concat(distinct ?attributen;
    separator='; ') as ?attributen)
(group_concat(distinct ?trefwoorden ;
    separator='; ') as ?trefwoorden)
{
  service <https://api.labs.kadaster.nl/datasets/bag/praktijkhandleiding/services/default/sparql> {
    ?phObject
      ph:attributen/schema:name ?attributen;
      ph:relaties ?relaties;
      schema:keywords/schema:name ?trefwoorden;
      schema:legislationLegalForce ?legislation;
      schema:name ?objectLabel;
      schema:url ?phURL.
  }
  ?bagObject
    a ?objectType;
      rdfs:label ?objectLabel;
      rdfs:comment ?objectDefinitie .
}
limit 10
